import React from 'react';
import './App.css';
import {BrowserRouter as Router, Route} from 'react-router-dom'
import QuizForm from './Quiz/QuizForm/QuizForm';


function App() {

     return (
       <div>
        <Router>
          <React.Fragment>
            <Route exact path="/" component={QuizForm} />
          </React.Fragment>
        </Router>
      </div>
  );
}

export default App;
